import React from "react";

function Home() {
    return (
    	<div id = "Home">
    	<p id = "Message"> Get started! Create a new program or load a saved project </p>
    	<div>
    	<form>
	    	<button className = "Create"> + Create New Program </button>
	    	</form>
	    	<button className = "Create"> Find Saved Program </button>
    	</div>


    	</div>
    );
}

export default Home;
